create table cart_product
(
    id      serial not null
        constraint cart_product_pkey
            primary key,
    name    varchar(300),
    mark    varchar(300),
    price   varchar(10),
    info    varchar(3000),
    image   bytea,
    email   varchar(300),
    company integer,
    qtd     integer
);

alter table cart_product
    owner to rgyxqnrswarutq;

